import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import Image from 'next/image';

const imageSrc = `data:image;base64,`;
export default function Page() {
  return (
    <Container>
      <Typography variant="h1">Images Base64</Typography>
      <Image
        src={imageSrc}
        alt="image base64 original"
        width={128}
        height={128}
      />
      {'abcdefghijklmnopqrstuvwxyz1234567890'.split('').map((variation) => (
        <Image
          key={variation}
          src={imageSrc.slice(0, -1) + variation}
          alt={'image base64 ' + variation}
          width={128}
          height={128}
        />
      ))}
    </Container>
  );
}
